const Square = ({ number, color }) => {
    const squareStyle = {
        backgroundColor: color,
        width: '100px',
        height: '100px',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        border: '1px solid black',
        borderRadius: '5px',
    };

    return (
        <div style={squareStyle}>
            {number}
        </div>
    );
}

export default Square;
